// Styles
import { Text } from '@chakra-ui/core';

// Context
const HistoryItem = ({ id, product, quantity }) => {
  return (
    <React.Fragment>
      <Text alignSelf="center">{product}</Text>
      <Text alignSelf="center">{quantity}</Text>
    </React.Fragment>
  );
};
export default HistoryItem;
